import React, { Component } from 'react';
import './App.css';


export class Score extends Component{

    constructor(score){
        super()
        this.score = 0
    }

    render(){

        return(
            <div class='score'>
                {<span>'Your score is: ', this.score</span>}
            </div>
        )

    }

}
